CREATE DEFINER=`root`@`localhost` FUNCTION `Animal_Neighbor_Factor`(pmin_before int, pmin_after int, pdist int) RETURNS char(1) CHARSET latin1
BEGIN 
    DECLARE vid VARCHAR(30);
	DECLARE vlat decimal(14,4);
    DECLARE vlon decimal(14,4);
	DECLARE vdatetime datetime;
    DECLARE vyearF int;
    DECLARE vmonF int;    
    
    -- verify which columns need consider
	select id, lat, lon, datetime, yearF, monF into vid, vlat, vlon, vdatetime, vyearF, vmonF
	from tb_data_factor order by lat desc, lon desc, datetime desc limit 1;

    -- TEST SITUATIONS:
	-- Situation 1: distance (lat/lon) and time (datetime) 
	IF (vlat is not null and  vlon is not null and vdatetime is not null) THEN 
		 INSERT INTO tb_distance_Animal_Factor
		 SELECT  A.band id, A.lat, A.lon, A.datetime, month(A.datetime) monF, 
				 year(A.datetime) yearF, A.estado, B.factor, VINCENTY(A.lat, A.lon, B.lat, B.lon) dist
		 FROM TB_rst_movanimal_estado A, tb_data_factor B
         where DATE_FORMAT(A.datetime, '%Y%m%d') = DATE_FORMAT( B.datetime, '%Y%m%d') and 
                B.datetime between DATE_SUB(A.datetime, INTERVAL pmin_before MINUTE) and 
								   DATE_ADD(A.datetime, INTERVAL pmin_after MINUTE) and VINCENTY(A.lat, A.lon, B.lat, B.lon) < pdist 				
		group by A.band, A.lat, A.lon   order by A.datetime desc  limit 1;
                                   
	-- Situation 2: no distance and time (datetime)      
    ELSEIF (vlat is null and  vlon is null and vdatetime is not null) THEN 
		 INSERT INTO tb_distance_Animal_Factor
		 SELECT  A.band id, A.lat, A.lon, A.datetime, month(A.datetime) monF, year(A.datetime) yearF, A.estado, 
	            (select B.factor from tb_data_factor B  
				 where DATE_FORMAT(A.datetime, '%Y%m%d') = DATE_FORMAT( B.datetime, '%Y%m%d') and 
                B.datetime between DATE_SUB(A.datetime, INTERVAL min_before MINUTE) and 
								   DATE_ADD(A.datetime, INTERVAL min_after MINUTE) order by B.datetime desc limit 1) factor, NULL dist
		 FROM TB_rst_movanimal_estado A;
         
	-- Situation 3: no distance and datetime(mon/year)
	ELSEIF (vlat is null and  vlon is null and yearF is not null and monF is not null) THEN 
    	INSERT INTO tb_distance_Animal_Factor
		SELECT  A.band id, A.lat, A.lon, A.datetime, month(A.datetime) monF, year(A.datetime) yearF, A.estado,
			(select B.factor  from tb_data_factor B  where month(A.datetime) = B.monF and year(A.datetime) = B.yearF limit 1) factor, NULL dist
		FROM TB_rst_movanimal_estado A;
    END IF;
    
    RETURN '1';
	
END ;;
