/*!50003 SET sql_mode              = 'NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ ;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `vincenty`(
        lat1 FLOAT, lon1 FLOAT,
        lat2 FLOAT, lon2 FLOAT
     ) RETURNS float
    NO SQL
    DETERMINISTIC
    COMMENT 'Returns the distance in degrees on the Earth between two known points\n             of latitude and longitude using the Vincenty formula. Multiply by 111.045 to convert to KM \n             from http://en.wikipedia.org/wiki/Great-circle_distance \n             http://www.plumislandmedia.net/mysql/vicenty-great-circle-distance-formula/'
BEGIN
    RETURN 111.045 * 
    DEGREES(
		ATAN2(
			SQRT(
				POW(COS(RADIANS(lat2))*SIN(RADIANS(lon2-lon1)),2) +  
				POW(
					COS(RADIANS(lat1))*SIN(RADIANS(lat2)) - 
					(SIN(RADIANS(lat1))*COS(RADIANS(lat2)) * COS(RADIANS(lon2-lon1))),
				2) 
			), 
				SIN(RADIANS(lat1))*SIN(RADIANS(lat2)) + COS(RADIANS(lat1))*COS(RADIANS(lat2))*COS(RADIANS(lon2-lon1))
			) 
	); 
END ;;
DELIMITER ;
