BEGIN
		DECLARE done INT DEFAULT 0;
		DECLARE pat double;
		DECLARE pdate date;
        DECLARE phour double;
		
		DECLARE curs CURSOR FOR (SELECT  cast(datetime as date) date , hour(datetime) hour FROM TB_RST_MovAnimal_Estado);
		DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;

		OPEN curs;

