CREATE DEFINER=`root`@`localhost` PROCEDURE `getperiodoestado`()
BEGIN
	DECLARE done INT DEFAULT 0;
	DECLARE done2 INT DEFAULT 0;
    DECLARE count double DEFAULT 1;
    DECLARE idx1 int;
    DECLARE minSeq1 time;
	DECLARE maxSeq1 time;
    DECLARE yearmonidest1 VARCHAR (50);

    BEGIN 
		DECLARE curs CURSOR FOR (select distinct concat(id, estado, year(date), month(date)) yearmonidest 
                                 From TB_Periodo_Estado_JAguar_limpa  order by yearid, month(date), estado, minSeq);
                                 
		DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;
		OPEN curs;
			first_cur:REPEAT
			FETCH curs INTO  yearmonidest1;
				IF NOT done THEN	
					BEGIN 
					-- <calcula a distancia entre os animais> --      
						DECLARE curs2 CURSOR FOR (
                            select A.idx, A.minSeq, A.maxSeq
							From TB_Periodo_Estado_JAguar_limpa A
                            where concat(A.id, A.estado, A.yearSeq, month(A.date)) = yearmonidest1
                                 And not exists (select B.idx from Periodo_Freq B 
                                                         where A.id = B.id and A.estado = B.estado and A.yearSeq = B.yearSeq and 
														 Month(A.date) = B.mon and 
                                                         (TIME_FORMAT(minSeq, '%H:%i') = TIME_FORMAT(B.minSeq, '%H:%i') and
										                 TIME_FORMAT(maxSeq, '%H:%i') = TIME_FORMAT(B.maxSeq, '%H:%i'))
                                                         order by yearid, month(date), estado, minSeq));
                                
							DECLARE CONTINUE HANDLER FOR NOT FOUND SET done2 = 1;					
