CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_Lista_Resultado_Correlacao`()
BEGIN
	select *, (CASE WHEN phi >= -1.0 and phi <= -0.7 THEN 'FOAN' 
				 WHEN phi > -0.7 and  phi <= -0.3 THEN 'FAAN'
				 WHEN phi > -0.3 and phi <= 0.3 then 'PONE'
				 WHEN phi > 0.3 and phi <=  0.7 then 'FAPO'
				 WHEN phi > 0.7  then 'FOPO' 
				 ELSE 'INDEFINIDO' END ) CORR 
	From TB_Rules_Assoc where lhs <>'{}' order by phi desc;

END ;;
DELIMITER ;
