CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_Lista_Resultado_CorrelacaoPearson`()
BEGIN
	select *, (CASE
				 WHEN phi = -1 THEN 'PNC' 
				 WHEN phi =  0 THEN 'NC'
				 WHEN phi =  1 THEN 'PPC'
				 WHEN phi > -1 and  phi <= -0.68 THEN 'SNC'
                 WHEN phi >= - 0.67 and  phi <= -0.36 THEN 'MNC'
				 WHEN phi >= - 0.35 and  phi <= 0.35 THEN 'WNC'                 
				 WHEN phi >= 0.36 and phi <= 0.67 then 'SPC'
				 WHEN phi >= 0.68 and phi <  1 then 'SPC'
				 ELSE 'INDEFINIDO' END ) CORR 
	From TB_Rules_Assoc where lhs <>'{}' order by phi desc;

END ;;
