CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_TrataComportamento`()
BEGIN
		-- alterar o resultado da tabela de estados de comportamento para pontos no lugar de vÃ­rgula 
		-- e #N/A para NA
        ALTER TABLE TB_RST_MovAnimal_Estado CHANGE COLUMN `res_rad_0.1_th_0` `res` DOUBLE NULL DEFAULT NULL ;

		update TB_RST_MovAnimal_Estado set res =  REPLACE(res,',','.') ;
		update TB_RST_MovAnimal_Estado set res =  REPLACE(res,'#N/A','NA');

		-- adicionar os campos estado e periodo
		alter table TB_RST_MovAnimal_Estado add periodo char(1);
		alter table TB_RST_MovAnimal_Estado add estado varchar(30);

		-- com base no valor do residuo classificar o estado do comportamento como "Forrageamento", "Descanso", "TrÃ¢nsito" ou "Indefinido" e "NA"
		update TB_RST_MovAnimal_Estado set estado = CASE WHEN cast(res as decimal(14,4)) = 0  THEN 'Transit'
															WHEN cast(res as decimal(14,4)) > 0 THEN 'Forrage'
															WHEN cast(res as decimal(14,4)) < 0 THEN 'Rest'
															WHEN res is null THEN 'NA' ELSE 'Undefined' END;                                                            
END ;;
